(118, 'en', '', 'MTL', 'mtl@mailinator.com', 1, 1, NULL, NULL, '2019-06-05 02:30:21', NULL, NULL, NULL, '+1', '', '$2y$10$2XFyTnzLqwycDYgODrnbP.vl6TFT/kFo2pCDSN8j6Kgb3bdjZyXFq', NULL, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, NULL, 3, 0, NULL, 2, NULL, '', '', NULL, 2, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, '2019-06-05 02:29:47', '2019-06-05 02:30:23', NULL, '92995707'),
(119, 'en', NULL, 'romanov', 'lidwin.cleetus@xicom.biz', 1, 1, NULL, 26, '2019-06-05 03:35:40', NULL, NULL, NULL, '+91', '98653269', '$2y$10$RW/Wp/tBrxCgr4EWFTRbH.IPJeAdkbRJYtTpeWgGPnbSBiqdMDGYq', NULL, 0, '34', 0, NULL, NULL, 'thailand', 'project', 'alel', NULL, 'Primarily playing as an attacking midfielder and as a wide midfielder, Hazard is known for his creativity, speed, dribbling and excellent passing.[4][5] He has earned critical acclaim for his playing style, with the media, coaches, and players drawing comparisons to Ballon d\'Or winners Lionel Messi and Cristiano Ronaldo,[6][7][8][9] and Hazard is widely considered one of the best players in the world.[10][11][12][13][14]\n\nHazard is the son of two former footballers and began his career in Belgium playing for local youth clubs. In 2005, he moved to France where he began his senior career, joining first division club Lille. Hazard spent two years in the club\'s academy and, at the age of 16, made his professional debut in November 2007. He went on to become an integral part of the Lille team under manager Rudi Garcia, racking up over 190 appearances. In his first full season as a starter, he won the National Union of Professional Footballers (UNFP) Young Player of the Year award, becoming the first non-French player to win the award.[15] In the 200910 season, Hazard captured the award again, becoming the first player to win the award twice.[16] He was also named to the league\'s Team of the Year.', 1, 1, 3, 3, 1, NULL, 2, '1559725939.png', '', '', NULL, 2, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, '2019-06-05 03:34:57', '2019-06-05 03:43:58', NULL, '92997712'),
(120, 'en', 'Uma kusum', 'Elina', 'elina@mailinator.com', 2, 1, NULL, 21, '2019-06-05 04:53:59', NULL, NULL, NULL, '+1', '', '$2y$10$zOA3SZjlg3aaq4NRXhAey.WYzT3vCKBeYL9TqyAEwLWLRmgaOEM4S', NULL, 1, '23', 3, NULL, NULL, 'Shimla', 'XXXCMCA', 'GHgj', NULL, 'DF gdf', 1, 1, 1, 3, 1, NULL, 2, '1559818789.png', '42', '42', 'English', 2, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, '2019-06-05 04:53:43', '2019-06-06 05:29:49', NULL, '93002065'),
(121, 'en', 'rtyuja', 'moriarity', 'lidwin.cleetus@xicom.biz', 1, 1, NULL, 34, '2019-06-05 06:26:40', NULL, NULL, NULL, '+91', '2252363252', '$2y$10$U3jbJICfSHZ3Y5eOEnyEoOv86t6/ZWjjeWcv9wx0fJRuyxfJdZRgG', NULL, 0, '45', 0, NULL, NULL, 'thailand', 'romco', 'sleeping', NULL, 'Hazard was instrumental in Baku, scoring a second-half brace as Chelsea beat Arsenal 4-1 to win the trophy, but the match may have been his last for the club, with Real Madrid expected to sign the 28-year-old forward this summer.\n\nAsked about his future after Chelseas victory, Hazard said: I have made my decision already and now Im waiting on both clubs, like you wait and the fans wait. You will know in a couple of days.\n\nHowever, one week on from the final, there has be no official announcement over Hazards future. Chelsea are still holding out for a fee of 130m (115m) for the Belgian, while Madrid are hopeful of landing him for around 100m (89m).', 1, 1, 3, 3, 1, NULL, 2, '1559736221.png', NULL, NULL, NULL, 2, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, '2019-06-05 06:26:05', '2019-06-05 06:33:41', NULL, ''),
