(125, 'en', 'moreia', 'Chelsea', 'lidwin.cleetus@xicom.biz', 1, 1, NULL, 25, '2019-06-06 07:19:52', NULL, NULL, NULL, '+91', '88585858555', '$2y$10$u9ClytIUObbU4NnjKB8/setJnKH9Y84IXEXJbsNV5NUJVOFCx/C0q', 'Friendship', 3, '23', 4, NULL, NULL, 'tahil', 'pm', 'reading', NULL, 'The other two central midfield positions will be held by Ruben Loftus-Cheek and Mason Mount. Ruben Loftus-Cheek solidified his place in any Chelsea XI next season through his stellar play this season. Loftus-Cheek is the goalscoring midfielder for whom Chelsea has been searching for awhile. His elusiveness and skill on the ball makes him an ideal Santo midfielder.\n\nOne of the staples of Santos style of play is his triangular passing lanes. Almost all ball movement in the midfield creates triangles, meaning the two central attacking midfielders must be able to make slicing off-ball runs. Loftus-Cheek is the best Chelsea midfielder for that job\n\nThe other two central midfield positions will be held by Ruben Loftus-Cheek and Mason Mount. Ruben Loftus-Cheek solidified his place in any Chelsea XI next season through his stellar play this season. Loftus-Cheek is the goalscoring midfielder for whom Chelsea has been searching for awhile. His elusiveness and skill on the ball makes him an ideal Santo midfielder.\n\nOne of the staples of Santos style of play is his triangular passing lanes. Almost all ball movement in the midfield creates triangles, meaning the two central attacking midfielders must be able to make slicing off-ball runs. Loftus-Cheek is the best Chelsea midfielder for that job', 1, 1, 1, 3, 1, NULL, 1, NULL, NULL, NULL, NULL, 2, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, '2019-06-06 07:18:52', '2019-06-06 07:20:33', NULL, ''),
