(129, 'en', 'bon', 'Robert', 'lidwin.cleetus@xicom.biz', 1, 1, NULL, 24, '2019-06-10 04:39:42', NULL, NULL, NULL, '+91', '9868586534', '$2y$10$Y9wHOTu.CiNfNEgbKGk3OO4Xz9PGs0rvBE5J1kzHt5YJxRTtcaBhu', 'Friendship,Daily Activities', 0, '55', NULL, NULL, NULL, 'hishej', 'bjsjs', 'reading', NULL, 'communities.Keralahas a reputation of being, communally, one of the most religiously diverse states in India. According to 2011Census of Indiafigures, 54.73% of Kerala\'s population areHindus, 26.56% are Muslims, 18.38% areChristians, and the remaining 0.32% follows other religions or no religion.[2]\n\nVarious tribal people in Kerala have retained the religious beliefs of their ancestors.Hindusconstitute the majority in all districts exceptMalappuram, where they are outnumbered by Muslims.[3]As of 2016,Hindus,Muslims,Christiansand others account for 41.88%, 42.55%, 15.35% and 0.22% of the total child births in the state, respectively.[4]Consequently, Kerala\'s religious landscape is set to diversify further in the future.', 1, 1, 1, 3, 1, NULL, 1, NULL, NULL, NULL, NULL, 2, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, '2019-06-10 04:39:10', '2019-06-10 04:41:51', NULL, ''),
